import React from "react";
import ReactDOM from "react-dom";
import "./index.css"

const name="Dinsha Jaiswal";
const img1="https://picsum.photos/200/300";
const img2="https://picsum.photos/300/300";
const img5="https://picsum.photos/200/300";
const links="https://www.google.com";
ReactDOM.render(
  [<h1 class="heading">My name is {name}</h1>,
    <img src={img1} alt=" not found!!"/>,
    <img src={img2} alt=" not found!!"/>,
    <a href={links}  target="_blank"><img src={img5} alt=" not found!!"/></a>
],document.getElementById("root")

);
